import React from 'react';
import './App.css';

import SearchForm from './components/SearchForm/SearchForm';
import { Discography } from './Discography';

const App = () => {
  // const album: Album = { name: 'albumName' };
  const discos: Discography[] = [
    {
      artist: 'Linkin Park',
      albuns: [
        {
          name: 'Album Name1',
          source_image: './assets',
          year: 2017,
          songs: [{ title: 'Song1' }, { title: 'Song2' }],
        },
        {
          name: 'Album Name2',
          source_image: './assets',
          year: 2017,
          songs: [{ title: 'Song1' }, { title: 'Song2' }],
        },
      ],
    },

    {
      artist: 'Muse',
      albuns: [
        {
          name: 'Album xxxx Name1',
          source_image: './assets',
          year: 2017,
          songs: [{ title: 'Song1' }, { title: 'Song2' }],
        },
        {
          name: 'Albumxxxxx Name2',
          source_image: './assets',
          year: 2017,
          songs: [{ title: 'Song1' }, { title: 'Song2' }],
        },
      ],
    },
  ];
  console.log(discos.filter((artist) => artist.artist === 'Muse'));
  return (
    <div className='App'>
      <h2>Vmusic</h2>
      <SearchForm />
    </div>
  );
};

export default App;
